var appendCharacters = function(s, t) {

let min;
  for(i=0;i<t.length;i++)
    {
        for(j=0;j<s.length/2;j++)
            {
                if(t[i]==s[j])
                    {
                     
                        break;
                    }
            }
       if(j==s.length)
            {
                min = t.length-i;
                break;
                
            }
    }
    if(i==t.length)
        {
            min = t.length-i;
        }

    return min;
 };
 appendCharacters("","coding");
 